import { useState } from "react";
import "./edit.css";
import Input from "../InputField/InputField";
import { useSelector, useDispatch} from "react-redux";
import { updateUsers } from "../../Redux/apiRequest"

const EditPage = (props) => {
  const {setEdit} = props;
  const avatarURL = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTk1M82RdtG50fnienI7ZbEX84rIDe2UP7NdQ&usqp=CAU",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS1XROZnieylTJfVGx0p2AOYqblRJpM2sikKA&usqp=CAU",
  ];
  const user = useSelector((state) => state.user);
  const dispatch = useDispatch();
  const [name, setName] = useState(user.name);
  const [age, setAge] = useState(user.age);
  const [about, setAbout] = useState(user.about);
  const [theme, setTheme] = useState(user.theme);
  const [url, setUrl] = useState(user.avaUrl);
  const handleSubmit = (e) =>{
    e.preventDefault();
    setEdit(false);
    const updateUser = {
       name: name,
       age:age,
       about:about,
       avaUrl: url,
       theme: theme,
    };
    updateUsers(updateUser,dispatch);
  }
  return (
    <>
      <form onSubmit={handleSubmit}>
        <section className="edit-container">
          <button className="close">Save</button>
          <div className="edit-profile">Edit Profile</div>
          <div className="input-container">
            <Input label="Display Name" data={user.name} setData={setName} />
            <Input label="Age" data={user.age} setData={setAge} />
            <Input
              inputType="textarea"
              classStyle="input-about"
              label="About"
              data={user.about}
              setData={setAbout}
            />
          </div>
          <label>Profile Picture</label>
          <div className="input-image-container">
            {avatarURL.map((url,idex) => {
              return (
                <img key={idex}
                  onClick={(e) => setUrl(url)}
                  src={url}
                  alt=""
                  className="input-image"
                />
              );
            })}
          </div>
          <div className="theme-container">
            <input
              type="color"
              placeholder={theme}
              onChange={(e) => setTheme(e.target.value)}
            />
          </div>
        </section>
      </form>
    </>
  );
};

export default EditPage;
